import { Header } from './Components'

// const theme = {
//   primary: 'red',
//   secondary: 'blue'
// }

// createTheme(theme)

const App = () => (
  <ThemeProvider>
    <BrowserRouter>
      <Header>
        <Routes>
          <Route path='' element={ <Dashboard /> } />
        </Routes>
      </Header>
    </BrowserRouter>
  </ThemeProvider>
)

export default App
